import { Main,Table } from "govuk-react";
function DoctorAppointment() {
    
    return(
        <div>
<Main>

<Table
  caption="Doctor Name: List Of Appointments Booked"
  head={<Table.Row><Table.CellHeader>Patient NHS number </Table.CellHeader><Table.CellHeader>Patient Name </Table.CellHeader><Table.CellHeader numeric setWidth="12%"> Date</Table.CellHeader><Table.CellHeader numeric setWidth="10%"> Time</Table.CellHeader> <Table.CellHeader setWidth="45%">Appointment Note</Table.CellHeader></Table.Row>}
>
  <Table.Row>
    <Table.CellHeader>
      exmaple
    </Table.CellHeader>
    <Table.Cell numeric>
E    </Table.Cell>
    <Table.Cell numeric>
time 
    </Table.Cell>
  </Table.Row>
  
</Table>
</Main>

        </div>
    );
}
export default DoctorAppointment;
